<p>圈复杂度(Cyclomatic complexity)是一种代码复杂度的衡量标准，在1976年由Thomas J. McCabe, Sr. 提出。在软件测试的概念里，圈复杂度用来衡量一个模块判定结构的复杂程度，数量上表现为线性无关的路径条数，即合理的预防错误所需测试的最少路径条数。圈复杂度大说明程序代码可能质量低且难于测试和维护，根据经验：</p>
<p><strong>程序的可能错误和高的圈复杂度有着很大关系。</strong></p>
<h1> 圈复杂度衡量标准</h1>
<table>
<thead>
<tr>
<th><strong>圈复杂度</strong></th>
<th><strong>代码状况</strong></th>
<th><strong>可测性</strong></th>
<th><strong>维护成本</strong></th>
</tr>
